that would return an instance of `ThreadChannel` when used in a thread.

You couldn't type-check it in js(it's possible in TS with a type guard though), so an approach to this can be - fetch a list of all the guild channels
```js
const channels = await interaction.guild.channels.fetch();
```
this would most likely be a `Collection` - <https://discord.js.org/#/docs/collection/main/class/Collection>

You'd want to extract all the channel IDs and compare the `interaction.channel.id` against them. If it doesn't match, command was called in Thread.

A better approach - 

```js
const guildChannel = await interaction.channel.fetch(interaction.channel.id)
if (!guildChannel) {
  // thread
}
```

